package db.domain;import java.util.Arrays;public class WarSituationImpl implements WarSituation {	@Key	private int situationId;	private int createTime;	private byte [] data;	public WarSituationImpl() {	}	public WarSituationImpl(WarSituation c) {		this.situationId = c.getSituationId();		this.createTime = c.getCreateTime();		this.data = c.getData();	}	@Override	public String tableName() {		return "war_situation";	}	public void setSituationId(int situationId) {		this.situationId = situationId;	}	public int getSituationId() {		return this.situationId;	}public void addSituationId(int situationId) {		this.situationId += situationId;}	public void setCreateTime(int createTime) {		this.createTime = createTime;	}	public int getCreateTime() {		return this.createTime;	}public void addCreateTime(int createTime) {		this.createTime += createTime;}	public void setData(byte [] data) {		this.data = data;	}	public byte [] getData() {		return this.data;	}}